import styled from '@emotion/styled';

const MapPage = () => {
  let ar = [10, 20, 30];
  let res = ar.map(() => {
    return 5;
  });
  console.log(res);

  let ar2 = [<h2>title</h2>, <h2>title2</h2>, <p>안녕하세요</p>];

  let todoList = [
    'java study',
    'html study',
    'css study',
    'team study',
    'k',
    'kkk',
    'kkkkk',
    'kkkkkkkk',
    'lkkkkkkkkkk',
  ];

  let list = todoList.map((element) => {
    return element - 1;
  });

  var postList = [
    {
      id: 5,
      title: 'cool',
      writer: 'sadf@sdaf.com',
      createdAt: '2023-08-08',
      updateedAt: '2023-09-15',
    },
    {
      id: 6,
      title: 'cool123',
      writer: 'qwesdfdsaff@sdaf.com',
      createdAt: '2023-07-08',
      updateedAt: '2023-09-15',
    },
    {
      id: 7,
      title: 'hot',
      writer: 'jsgaebrf@sdaf.com',
      createdAt: '2023-06-08',
      updateedAt: '2023-09-15',
    },
  ];

  fetch('https://koreanjson.com/posts').then((response) => {
    console.log('데이터 결과 가져옴');
    return response.json();
  });

  return (
    <>
      <h1>map function</h1>
      <h2> {res} </h2>
      <h2> {ar2} </h2>
      <h2> {list} </h2>
      <h1>글목록</h1>
      <WriteWrap>
        <WriteRow>sdf</WriteRow>
      </WriteWrap>
    </>
  );

  const WriteWrap = styled.div`
    background-color: skyblue;
    border-radius: 20px;
    box-shadow: pink;
    width: 80%;
    margin: 0 auto;
    padding: 10px;
  `;

  const WriteRow = styled.div`
    display: flex;
    & p {
      text-align: center;
      flex-grow: 1;
    }
    & p:nth-child(1) {
      width: 10%;
    }
  `;
};

export default MapPage;
